import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';

import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './home'; // 你的主页组件

const TopBar = () => {
  return (
    <Navbar collapseOnSelect expand="lg" className={"topBar"}>
      <Container>
        <Navbar.Brand href="#home" expand="lg" id="title">SpeakTrainer</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
           <Nav fill variant="tabs" defaultActiveKey="/home">
            <Nav.Item>
              <Nav.Link expand="md" href="/home" id = "menu">Home</Nav.Link>
            </Nav.Item>
              <Nav.Item>
              <Nav.Link expand="md" eventKey="link-1" id = "menu">Voice</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link expand="md" eventKey="link-2" id = "menu">Text</Nav.Link>
            </Nav.Item>
           </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>

  );
}

function App() {
  return (
    <Router>
      <TopBar />
      <Routes>
        <Route path="/" element={<HomePage />} />
      </Routes>
    </Router>
  );
}
export default App;
export {TopBar};
